import React from 'react';
import s from './CalcCountBut.module.scss'
import { ItemTypes, ModeType } from '../Calculator';

type CalcCountButType = {
    board: ModeType
    draggable: boolean
    item: ItemTypes
    setCurrentBoard: (board: null | ModeType) => void
    setCurrentItem: (item: null | ItemTypes) => void

}

export const CalcCountBut = ({ board, draggable, item, setCurrentBoard, setCurrentItem }: CalcCountButType) => {
    return (
        <div className={s.count_wrapper} draggable={true}>
            <div className={s.but}>1</div>
            <div className={s.but}>2</div>
            <div className={s.but}>3</div>
            <div className={s.but}>4</div>
            <div className={s.but}>5</div>
            <div className={s.but}>6</div>
            <div className={s.but}>7</div>
            <div className={s.but}>8</div>
            <div className={s.but}>9</div>
            <div className={s.zero}>0</div>
            <div className={s.but}>.</div>
        </div>

    );
}
